	public void convertFrom9LikertTo7Likert() {	
		this.difficulty = 6.0/8.0 * (this.difficulty - 1) + 1;
		this.visualAesthetics = 6.0/8.0 * (this.visualAesthetics - 1) + 1;
		this.fun = 6.0/8.0 * (this.fun - 1) + 1;
		
		PrintWriter writer;
		try {
			writer = new PrintWriter(path + "labels2/" + name, "UTF-8");
			writer.println(this.difficulty); 
			writer.println(this.visualAesthetics);
			writer.println(this.fun);
			writer.close();
		} catch (FileNotFoundException | UnsupportedEncodingException e) {
			e.printStackTrace();
		}
	}

	private void fixWalls(Level level, int width, int height)
	{
		boolean[][] blockMap = new boolean[width + 1][height + 1];
		for (int x = 0; x < width + 1; x++)
		{
			for (int y = 0; y < height + 1; y++)
			{
				int blocks = 0;
				for (int xx = x - 1; xx < x + 1; xx++)
				{
					for (int yy = y - 1; yy < y + 1; yy++)
					{
						if (level.getBlockCapped(xx, yy) == (byte) (1 + 9 * 16)) blocks++;  //GROUND (Bloco marron)
					}
				}
				blockMap[x][y] = blocks == 4;                
			}
		}
		
		blockify(level, blockMap, width + 1, height + 1);
	}

	private void blockify(Level level, boolean[][] blocks, int width, int height)
	{
		int to = 0;

		boolean[][] b = new boolean[2][2];
		for (int x = 0; x < width; x++)
		{
			for (int y = 0; y < height; y++)
			{
				for (int xx = x; xx <= x + 1; xx++)
				{
					for (int yy = y; yy <= y + 1; yy++)
					{
						int _xx = xx;
						int _yy = yy;
						if (_xx < 0) _xx = 0;
						if (_yy < 0) _yy = 0;
						if (_xx > width - 1) _xx = width - 1;
						if (_yy > height - 1) _yy = height - 1;
						b[xx - x][yy - y] = blocks[_xx][_yy];
					}
				}

				if (b[0][0] == b[1][0] && b[0][1] == b[1][1])
				{
					if (b[0][0] == b[0][1])
					{
						if (b[0][0])
						{
							level.setBlock(x, y, (byte) (1 + 9 * 16 + to)); //maroon block?
						}
					}
					else
					{
						if (b[0][0])
						{
							level.setBlock(x, y, (byte) (1 + 10 * 16 + to));//Block with lower grass
						}
						else
						{
							level.setBlock(x, y, (byte) (1 + 8 * 16 + to)); //Block with superior grass
						}
					}
				}
				else if (b[0][0] == b[0][1] && b[1][0] == b[1][1])
				{
					if (b[0][0])
					{
						level.setBlock(x, y, (byte) (2 + 9 * 16 + to));//Grass side block on the right
					}
					else
					{
						level.setBlock(x, y, (byte) (0 + 9 * 16 + to));//Block with grass on the left side
					}
				}
				else if (b[0][0] == b[1][1] && b[0][1] == b[1][0])
				{
					level.setBlock(x, y, (byte) (1 + 9 * 16 + to)); //maroon block, no grass          
				}
				else if (b[0][0] == b[1][0])
				{
					if (b[0][0])
					{
						if (b[0][1])
						{
							level.setBlock(x, y, (byte) (3 + 10 * 16 + to)); //Small the lower right corner.                            
						}
						else
						{
							level.setBlock(x, y, (byte) (3 + 11 * 16 + to)); //Small lower left corner                           
						}
					}
					else
					{
						if (b[0][1])
						{
							level.setBlock(x, y, (byte) (2 + 8 * 16 + to)); //upper right corner . Start of gap.                         
						}
						else
						{
							level.setBlock(x, y, (byte) (0 + 8 * 16 + to)); //top left corner . Other side of the gap                           
						}
					}
				}
				else if (b[0][1] == b[1][1])
				{
					if (b[0][1])
					{
						if (b[0][0])
						{
							level.setBlock(x, y, (byte) (3 + 9 * 16 + to));  //Small upper right corner                          
						}
						else
						{
							level.setBlock(x, y, (byte) (3 + 8 * 16 + to)); //Small top left corner
						}
					}
					else
					{
						if (b[0][0])
						{
							level.setBlock(x, y, (byte) (2 + 10 * 16 + to)); //lower right corner . opposite to a gap
						}
						else
						{
							level.setBlock(x, y, (byte) (0 + 10 * 16 + to)); //lower left corner . opposite to a gap
						}
					}
				}
				else
				{
					level.setBlock(x, y, (byte) (0 + 1 * 16 + to)); //yellow blocks                  
				}
			}
		}
	}
	
